/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { useState, useEffect } from 'react';
import { useCookies } from 'react-cookie';
import { ACCESS_TOKEN } from '../Constant';
import { OrderCell } from './OrderStyle';


const Orders = () => {
  const [cookies] = useCookies([ACCESS_TOKEN]);
  const token = cookies[ACCESS_TOKEN];
  const [orders, setOrders] = useState([]);

  const confirm = (response) => {
    const { orders } = response;
    console.log(orders);
    setOrders(orders)
  }

  useEffect(() => {
    fetch("http://localhost:3000/api/v1/orders", {
      "method": "GET",
      "headers": {
        "content-type": "application/json",
        "accept": "application/json",
        "Authorization": "token eyJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoxLCJleHAiOjM2MDAwMDAwMDE1OTM4MDkwOTZ9.w4XiVPFidW2dcCu62m8ZcLXw5RR7-tuNLT4SpdfJr_0"
      },
    })
    .then(response => response.json())
    .then(response => {
      confirm(response);
    })
    .catch(err => {
      debugger
      console.log(err);
    });
}, [])


  if (!token) {
    window.location.href = '/login';
  }


  return (
    <div>
      {orders.map((order, index) => (
        <OrderCell className="d-flex flex-row" key={index}>
          <div>{order.id}</div>
          <div>{order.quantity}</div>
          <div>{order.price}</div>
          <div>{order.shipping_fee}</div>
          <div>{order.total_price}</div>
          <div>{order.card_type}</div>
          <div>{order.created_at}</div>
        </OrderCell>
      ))}
    </div>
  );
};


export default Orders;
